drop table image;

  CREATE TABLE image (
      id TEXT,
      name TEXT,
      value TEXT,
      external_id TEXT null,
      _changed TEXT,
      _status TEXT,
      created_at INTEGER DEFAULT (strftime('%s', 'now')),
      updated_at INTEGER DEFAULT (strftime('%s', 'now'))
  );

